static PATTERNS:Lazy<HashMap<&str, Regex>> = Lazy::new(||{
    let mut items: HashMap<&str, Regex> = HashMap::new();
    items.insert("split_with_numeric", Regex::new(r"(\D+|\d+)").unwrap());
    items.insert("search_timezone_with_offset_series", Regex::new(r"[\+\-]\d{2}:\d{2}(?::\d{2})?").unwrap());
    items.insert("space", Regex::new(r"\s+").unwrap());
    items.insert("no_break_space", RegexBuilder::new(r"\xa0").unicode(true).build().unwrap());
    items.insert("symbol_normal", Regex::new(r"[,/|｜，·。+_-]").unwrap());
    items.insert("symbol_point", Regex::new(r"[.]").unwrap());
    items.insert("symbol_safe", Regex::new(r"[,|｜，·。+]").unwrap());
    items.insert("meridian", Regex::new(r"am|pm").unwrap());
    items.insert("date_reverse", Regex::new(r"\d{1,2}[,-/|.]\d{1,2}[,-/|.月]\d{4}").unwrap());
    items.insert("date_forward", Regex::new(r"\d{4}\s*[,-/|.年]\s*\d{1,2}\s*[,-/|.月]\s*\d{1,2}").unwrap());
    return items
});

static REGEX_UTC_TIMEZONE:Lazy<HashMap<&str, Regex>>= Lazy::new(||{
    let mut items: HashMap<&str, Regex> = HashMap::new();
    items.insert("TZZeroOffset", Regex::new(r"^(\d{4}-\d{2}-\d{2})\s*[T]\s*(\d{2}:\d{2}:\d{2})(\.\d+)?Z?([\+\-]\d{2,4}(?::\d{2}){0,2})$").unwrap());
    items.insert("TZOffset", Regex::new(r"^(\d{4}-\d{2}-\d{2})\s*[T]\s*(\d{2}:\d{2}:\d{2})Z?([\+\-]\d{2,4}(?::\d{2}){0,2})$").unwrap());
    items.insert("TZZero", Regex::new(r"^(\d{4}-\d{2}-\d{2})\s*[T]\s*(\d{2}:\d{2}:\d{2})(\.\d+)[Z]?").unwrap());
    items.insert("TZ", Regex::new(r"^(\d{4}-\d{2}-\d{2})\s*[T]\s*(\d{2}:\d{2}:\d{2})(\.\d+)?Z$").unwrap());
    return items
});


